import React from "react";

const Avatar = ({ image, scale }) => {
  var height = 48.0 * scale
  return (
    <div className={`h-[${height}] w-[${width}] rounded-full shadow-md overflow-hidden`}>
      <img src={image} className="w-full h-full object-cover" alt="avatar" />
    </div>
  );
};

export default Avatar;
